template <class T, class S>
ostream& operator<<(ostream& os, const pair<T, S>& p)
{
    return os << p.first << "," << p.second;
}

template <class T>
ostream& operator<<(ostream& os, const vector<T>& v)
{
    os << "[";
    for (const auto& t: v) {
        os << t << " ";
    }
    return os << "]\n";
}

//this gets RE, I think it's stack limitation
class Solution2 {
    public:
        void solve(vector<vector<char>> &board) {
            if (board.size() == 0 || board[0].size() == 0) return;

            auto n = board.size(), m = board[0].size();
            for (int i = 0; i < n; i++) {
                mark(board, i, 0); mark(board, i, m-1);
            }
            for (int i = 0; i < m; i++) {
                mark(board, 0, i); mark(board, n-1, i);
            }

            // cout << board << endl;
            for (auto& row: board) {
                for (auto& c: row) {
                    if (c == 'O') c = 'X';
                    else if (c == 'Y') c = 'O';
                }
            }
        }

        void mark(vector<vector<char>> &board, int i, int j) {
            if (board[i][j] == 'O') {
                board[i][j] = 'Y';
                if (i-1 >= 0) mark(board, i-1, j);
                if (i+1 < board.size()) mark(board, i+1, j);
                if (j-1 >= 0) mark(board, i, j-1);
                if (j+1 < board.size()) mark(board, i, j+1);
            }
        }
};

class Solution {
    public:
        using pos = pair<int, int>;
        void solve(vector<vector<char>> &board) {
            if (board.size() == 0 || board[0].size() == 0) return;

            queue<pos> sp;
            auto n = board.size(), m = board[0].size();
            for (int i = 0; i < m; i++) {
                if (board[0][i] == 'O') {
                    board[0][i] = 'Y'; sp.push({0, i});
                }
                if (board[n-1][i] == 'O') {
                    board[n-1][i] = 'Y'; sp.push({n-1, i});
                }
            }

            for (int i = 0; i < n; i++) {
                if (board[i][0] == 'O') {
                    board[i][0] = 'Y'; sp.push({i, 0});
                }
                if (board[i][m-1] == 'O') {
                    board[i][m-1] = 'Y'; sp.push({i, m-1});
                }
            }

            while (sp.size()) {
                // auto& p = sp.back(); sp.pop_back();
                auto& p = sp.front(); sp.pop();
                if (p.first > 0 && board[p.first-1][p.second] == 'O') {
                    board[p.first-1][p.second] = 'Y';
                    sp.push({p.first-1, p.second});
                }

                if (p.first < n-1 && board[p.first+1][p.second] == 'O') {
                    board[p.first+1][p.second] = 'Y';
                    sp.push({p.first+1, p.second});
                }

                if (p.second > 0 && board[p.first][p.second-1] == 'O') {
                    board[p.first][p.second-1] = 'Y';
                    sp.push({p.first, p.second-1});
                }

                if (p.second < m-1 && board[p.first][p.second+1] == 'O') {
                    board[p.first][p.second+1] = 'Y';
                    sp.push({p.first, p.second+1});
                }
            }

            //cout << board << endl;
            for (int i = 0; i < n; i++) {
                for (int j = 0; j < m; j++) {
                    if (board[i][j] == 'O') board[i][j] = 'X';
                    else if (board[i][j] == 'Y') board[i][j] = 'O';
                }
            }
        }
};

void test(vector<vector<char>> &board) {
    auto bd2 = board;
    Solution().solve(board);    
    cout << board << endl;
    Solution2().solve(bd2);
    cout << bd2 << endl;
}

vector<vector<char>> build_board(const vector<string>& vs)
{
    vector<vector<char>> bd(vs.size(), vector<char>(vs[0].size()));
    int m = vs[0].size();
    for(int i = 0; i < vs.size(); i++) {
        for (int j = 0; j < m; j++) {
            bd[i][j] = vs[i][j];
        }
    }
    return bd;
}

